import React,{useEffect} from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Assessment from '@material-ui/icons/Assessment';
import BubbleChart from '@material-ui/icons/TrendingUp';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import Chat from '@material-ui/icons/Chat';
import ShoppingBasket from '@material-ui/icons/ShoppingBasket';
import ThumbDown from '@material-ui/icons/ThumbDown';
import ThumbUp from '@material-ui/icons/ThumbUp';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import './demo.css';
import LinearProgress from '@material-ui/core/LinearProgress';
import { withStyles } from '@material-ui/core/styles';
import { Button } from 'react-bootstrap';
import history from './history.js';
import { TrendingUp } from '@material-ui/icons';
import $ from "jquery"

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-force-tabpanel-${index}`}
      aria-labelledby={`scrollable-force-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `scrollable-force-tab-${index}`,
    'aria-controls': `scrollable-force-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    width: '70%',
    position: 'absolute', left: '15%', right: '15%',
    backgroundColor: theme.palette.background.paper,
  },
}));

const BorderLinearProgress = withStyles((theme) => ({
  root: {
    height: 10,
    borderRadius: 5,
  },
  colorPrimary: {
    backgroundColor: theme.palette.grey[theme.palette.type === 'light' ? 200 : 700],
  },
  bar: {
    borderRadius: 5,
    backgroundColor: '#1a90ff',
  },
}))(LinearProgress);

export default function ScrollableTabsButtonForce() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  useEffect(() => {
    var settings = {
      "url": "http://34.70.245.51:8080/api/stocks",
      "method": "GET",
      "timeout": 0,
      "headers": {
        "Authorization": "OAuth oauth_consumer_key=\"M2jzUEdAcLsXOq523tudKPaL9\",oauth_token=\"915444142586650624-K8fq55ScxWmm0tAnALc3AFQZ4LTeRYB\",oauth_signature_method=\"HMAC-SHA1\",oauth_timestamp=\"1612068381\",oauth_nonce=\"X1SXS2NMTrR\",oauth_version=\"1.0\",oauth_signature=\"oRQsb4kihyTAPwvRVqG66Zlvv9U%3D\""
      },
    };

    j.ajax(settings).done(function (response) {
      console.log(response);
    });
   }, []);

  return (
    <div className={classes.root}>
      <AppBar position="static" color="secondary" style={{backgroundColor: "pink"}}>
        <Tabs
          value={value}
          onChange={handleChange}
          variant="scrollable"
          scrollButtons="on"
          indicatorColor="primary"
          textColor="primary"
          aria-label="scrollable force tabs example"
          AlignItems="center"
          textAlign='center'
          style={{backgroundColor: "pink"}}
        >
           <Typography variant="h3" color="white">GameStonks</Typography>
          <Tab label="Trending" icon={<TrendingUp />} {...a11yProps(0)} />
          <Tab label="My Stocks" icon={<Assessment />} {...a11yProps(1)} />
          <Tab label="Threads" icon={<Chat />} {...a11yProps(2)} />
          />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
       <p class="center">Welcome Deesha! </p>
      </TabPanel>
      <TabPanel value={value} index={1}>
      <div class="center dash"> 
          <h5>Stocks</h5>

          <z><br></br></z> 

          <div className={classes.root} class="line">

            <br />
            <BorderLinearProgress variant="determinate" value={66} />
          </div>


      </div>

      </TabPanel>
      <TabPanel value={value} index={2}>
        <div>
                {/* Dropdown menu */}
                <label for="cars">How many people have you seen in the last 2 weeks?</label>

        <select name="cars" id="cars">
        <option value="audi"></option>
        <option value="volvo">1-2</option>
        <option value="saab">3-5</option>
        <option value="mercedes">6-8</option>
        <option value="mercedes">9-12</option>
        </select>

        {/* Dropdown menu */}
        <label for="cars"><br></br>How many restaurants have you been to in the last 2 weeks?</label>

        <select name="cars" id="cars">
        <option value="audi"></option>
        <option value="volvo">1</option>
        <option value="saab">2</option>
        <option value="mercedes">3</option>
        <option value="mercedes">4</option>
        </select>

        <p></p>
        <Button variant="btn btn-success" onClick={() => {history.push('/page3'); window.location.reload();}}>Enter</Button>
        </div>
      </TabPanel>
      <TabPanel value={value} index={3}>
      <div>
      <div class="embed-container"><iframe width="500" height="400" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" title="COVID-19 Incidence Rate Per 100,000 by Census Tract - 2021/01/10 to 2021/01/16 (Mobile)" src="//www.arcgis.com/apps/Embed/index.html?webmap=5989e7d6f0e9424494b2a2a68bad8ae1&extent=-80.4965,43.4261,-78.9928,44.059&zoom=true&previewImage=false&scale=true&disable_scroll=true&theme=light"></iframe></div>
      </div>
      </TabPanel> 
    </div>
  );
}
